import React from "react";
import merch from "../views/MerchPage.module.css"
import {ClickDetailButton} from "./ClickButton";

function Tag(props) {
    return(
        <div className={merch.tile}>
            <div className={merch.tag}>
                <p>{props.name}</p>
                <p>{props.price}</p>
                <ClickDetailButton path={props.id}/>
            </div>
        </div>
    )
}

export default Tag;
